import './App.css';
import {useState} from "react"

function Work() {
  const [formData,setFormdata]=useState({
    query:"",
    source:""
  })

  const ResearchQueryForm = () => {
    const [formData, setFormData] = useState({
      query: '',
      source: ''
    });

    const [answer, setAnswer] = useState('');
    const [sources, setSources] = useState('');
  }  

  const handleChange=(e)=>{
    const {name,value}= e.target;
    setFormdata((prev)=>({
      ...prev,
      [name]:value
    }))
  }

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await fetch("https://d9c5-34-148-225-2.ngrok-free.app/api/process", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          query: formData.query,
          source: formData.source,
        }),
      });

      const data = await response.json();
      console.log("‚úÖ Answer:", data.answer);
      console.log("üîó Sources:", data.sources);

      // Update UI state with answer and sources
      setAnswer(data.answer);
      setSources(data.sources);

    } catch (error) {
      console.error("‚ùå Backend error:", error);
    }
  };

  return (
    <div className="App">
      {/* Left section for inputs */}
      <div className="input-section">
        {/* Siri-like wave animation */}
        <div className="wave-container">
          <div className="wave-circle">
            <div className="wave"></div>
            <div className="wave"></div>
            <div className="wave"></div>
            <div className="wave"></div>
            <div className="wave"></div>
            <div className="wave"></div>
          </div>
        </div>

        {/* Floating particles */}
        <div className="particles-container">
          <div className="particle"></div>
          <div className="particle"></div>
          <div className="particle"></div>
          <div className="particle"></div>
          <div className="particle"></div>
          <div className="particle"></div>
          <div className="particle"></div>
        </div>

        <form className="input-container" onSubmit={handleSubmit}>
          <h2 className="section-title">Research Query</h2>

          <label htmlFor="query">Enter your query</label>
          <input
            type="text"
            id="query"
            name="query"
            placeholder="What would you like to research?"
            value={formData.query}
            onChange={handleChange}
          />

          <label htmlFor="source">Sources</label>
          <input
            type="text"
            id="source"
            name="source"
            placeholder="Add reference sources or constraints..."
            value={formData.source}
            onChange={handleChange}
          />

          <button type="submit" className="submit-btn">Process Query</button>
        </form>
      </div>

      {/* Right section for output */}
      <div className="output-section">
        <div className="output-container">
          <h2 className="section-title">Research Findings</h2>

          <label htmlFor="answer">Results</label>
          <textarea 
            id="answer" 
            name="answer" 
            placeholder="Your research results will appear here..."
            rows="12"
            value={`${answer}\n\nSources: ${sources}`}  // Display both answer and sources
            readOnly  // Optional, to make the textarea non-editable
          ></textarea>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <div className="Work">
      <Work/>
    </div>
  );
}

export default App;
